def japan_basin_model(vs30):
    """
    Returns the centred z1.0 (mu_z1) based on the Japan model
    (equation 12)
    """
    coeff = 412.39 ** 2.0
    model = (-5.23 / 2.0) * np.log(
        ((vs30 ** 2.0) + coeff) / ((1360.0 ** 2.0) + coeff)
        ) - np.log(1000.)
    return np.exp(model)


